import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/boostrap.min.css";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="container">
        <p>Hello this is my app</p>
      </div>
    </Router>
  );
}

export default App;
